import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
        <div>
            <Link to='/'> Home </Link>
            <Link to='/tweet'> Tweet </Link>
            <Link to='/Input'> Input </Link>
            <Link to='/output'> Output </Link>
        </div>
        </nav>
    );
}

export default Nav;
